Photo by @amivitale | Lekupania cradles an orphaned gerenuk at Reteti Elephant Sanctuary in northern Kenya. Gerenuks are long-necked members of the antelope family. Their numbers are falling, largely because of habitat loss and fragmentation. Today there are fewer than 100,000 in the wild. 

Mostly known for its elephants, @r.e.s.c.u.e also takes in other species, including giraffes, rhinos, and gerenuks. Then it nurses them back to health and returns them to the wild. Learn more and get involved by following @amivitale and @r.e.s.c.u.e. 
@sararafoundation @kenyawildlifeservice #kenya #gerenuks #africa

Photo by @amivitale | Happy World Animal Day! Head rhino keeper Zacharia Mutai relaxes with Najin, one of the last two northern white rhinos on the planet. Zacharia, with Najin's other keepers, has had a front-row seat as the Biorescue Project works at @olpejeta conservancy in northern Kenya to restore this iconic species. 

Despite tremendous pressures on rhinos around the world, we have reason to celebrate. In September, the Biorescue Project announced the creation of five northern white rhino embryos, bringing the total to 22. This nourishes hope to produce offspring and give this keystone species a new future. Follow @amivitale @biorescue_project and @olpejeta, to learn more including how to help. 

@leibnizizw @OlPejeta conservancy @safariparkdvurkralove @kenyawildlifeservice @WRTIKenya @MinistryOfTourismAndWildlifeKE #rhinos #worldrhinoday #conservation #kenya #extinction

Photo by @amivitale | Happy World Rhino Day! Head rhino keeper Zacharia Mutai checks the eyes of Najin, one of the last two northern white rhinos on the planet, at Ol Pejeta Conservancy in Kenya. Najin and three other northern white rhinos arrived from the Dvůr Králové Zoo in the Czech Republic in 2009, part of an international effort to save the species from extinction. Zacharia is working with the BioRescue Project to restore this species. So far, 22 northern white rhino embryos have been created and one day will be implanted into a southern white rhino surrogate at Ol Pejeta.

Learn more, including how you can help save this species, by following @amivitale, @olpejeta, and @biorescue_project.
@leibnizizw @KenyaWildlifeService #Avantea @tunajibu @tourism_wildlifeke @bmbf.bund @leibnizgemeinschaft @safariparkdvurkralove #kenya #rhinos

Photos by @andrea_frazzetta | The Appian Way saw the splendor of Roman times and centuries of journeys, trade, and pilgrimages. Today the monumental complexes raised in surroundings of such rare beauty are a unique historical legacy.
After a long period of neglect, a revitalization is under way with the aim of reestablishing the route and saving the immense archaeological heritage spread along its path.
Seen in this carousel: The Amphitheater of Capua, the second biggest arena, after the Colosseum, and home of the first and most famous gladiator school;
one of the most significant findings made thus far on the Via Appia: a bust that historians refer to as the Philosopher’s head;
Sunday afternoon in Rome's Aqueducts Park, crossroads of the water network of ancient Rome, part of the Appia Antica Regional Park;
the Appian Way lost among wheat fields in the Basilicata region. A nearby necropolis was recently discovered during excavations along the route.
For the full story on this Roman-era "superhighway"—written by @ninastrochlic—visit the link in bio. Follow me @andrea_frazzetta for more images from this project. 
#Italy #appianway #Roma #lastrada

